FREQUENCY_TOLERANCE_RANGE = 1000
BURST_WIDTH_STEP = 5


class _IRProtocol:
    def __init__(self, name, frequency):
        self.name = name  # protocol's name
        self.frequency = frequency  # carrier frequency
        self.lin = []  # lead-in burst pair.
        self.lout = []  # lead-out burst pair.
        self.rin = []  # lead-in burst pair for repeat frame.
        self.rout = []  # lead-out burst pair for repeat frame.

        # raw intermediate data
        self.leadinH = []
        self.leadinL = []
        self.leadoutH = []
        self.leadoutL = []
        self.repinH = []
        self.repinL = []
        self.repoutH = []
        self.repoutL = []
        self.dataH = []
        self.dataL = []


